import { BrowserRouter, Routes, Route } from "react-router-dom";
import { CssBaseline, ThemeProvider } from '@mui/material'
import { indigo, amber } from '@mui/material/colors'
import { createTheme } from "@mui/material/styles";

import NavBar from './components/NavBar';
import HomePage from './pages/HomePage';
import AlbumsPage from './pages/AlbumsPage';
import SongsPage from './pages/SongsPage';
import AlbumInfoPage from './pages/AlbumInfoPage'
import MoviesPage from './pages/MoviesPage';
import MoviesInfoPage from "./pages/MoviesInfoPage";
import Stats from "./pages/Stats";
import PeoplePage from "./pages/PeoplePage";
import PeopleInfoPage from "./pages/PeopleInfoPage";
import OscarPage from "./pages/OscarPage";

// createTheme enables you to customize the look and feel of your app past the default
// in this case, we only change the color scheme
export const theme = createTheme({
  palette: {
    primary: indigo,
    secondary: amber,
  },
});

// App is the root component of our application and as children contain all our pages
// We use React Router's BrowserRouter and Routes components to define the pages for
// our application, with each Route component representing a page and the common
// NavBar component allowing us to navigate between pages (with hyperlinks)
export default function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/people" element={<PeoplePage />} />
          <Route path="/people/:imdb_name_id" element={<PeopleInfoPage />} />
          <Route path="/movies" element={<MoviesPage />} />
          <Route path="/movies/:movie_id" element={<MoviesInfoPage />} />
          <Route path="/oscar" element={<OscarPage />} />
          <Route path="/stats" element={<Stats />} />
        </Routes>
      </BrowserRouter>
    </ThemeProvider>
  );
}
